import React from "react";


export class Read extends React.Component{

    render(){
        return( // returns content for page
               <div>
                    <h3>Hello from read componet</h3>

                    <h3>{this.data.title}</h3>
                    <h3>{this.data.isbn}</h3>
                    <h3>{this.data.pageCount}</h3>
                    <img>{this.data.thumbnailUrl}</img>
                    <h3>{this.data.status}</h3>
                    <h3>{this.data.authors}</h3>
                    <h3>{this.data.categories}</h3>
               </div>
        );
    }
}
